import React, {useState} from "react";

function Login()
{
    //Setting state/declaration
    const [username, setUsername] = useState('');
    const [acountNumber, setAcountNumber] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');

    //Setting function to not use default get method on form
    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');
    }

    return(
        <>
        <h1>Login</h1>
        <br/>

        <div>
            <a className="customerLoginTab" href="/">Customer </a> <a className="staffLoginTab" href="/">Staff</a>
        </div>
        <br/>

        <form onSubmit={handleSubmit}>
            <label>Username</label><br/>
            <input type="text" value={username} onChange={(e) => setUsername(e.target.value)}/>
            
            <label>Account Number</label><br/>
            <input type="number" value={acountNumber} onChange={(e) => setAcountNumber(e.target.value)}/>

            <label>Password</label><br/>
            <input type="password" value={password} onChange={(e) => setPassword(e.target.value)}/>
            <br/>

            {error && <p style={{color: 'red'}}> {error} </p>}

            <button type="submit">Login</button>
        </form>
        
        </>
    );
}

export default Login;
